    // getPartLocation

    goToPart(args, util) {
        if (this.hasPose(args['PERSON_INDEX'])) {
            const pt = this.poseStates[args['PERSON_INDEX']].keypoints.find(point => point.name === args['PART']);
            if (pt) {
                if (pt.score > 0.2) {
                    const {x, y} = this.tfCoordsToScratch({"x": pt.x, "y": pt.y});
                    util.target.setXY(x, y, false);    
                }
            }
        }
    }

