    hasAPose() {
        return this.poseState && this.poseState.keypoints && this.poseState.score > 0.01;
    }

    hasPose(personIndex) {
        if (this.hasAPose()) {
            return this.poseStates[personIndex] && this.poseStates[personIndex].keypoints && this.poseStates[personIndex].score > 0.01;
        }
    }

    /**
     * @param {object} args - the block arguments
     * @param {BlockUtility} util - the block utility
     * @returns {number} class name if video frame matched, empty number if model not loaded yet
     */
    posePositionX(args, util) {
        // this.poseState.keypoints.find(point => point.name === args['PART'])
        if (this.hasPose(args['PERSON_INDEX'])){
            return this.tfCoordsToScratch({x: this.poseStates[args['PERSON_INDEX']].keypoints.find(point => point.name === args['PART']).x}).x;
        }
    }

    /**
     * @param {object} args - the block arguments
     * @param {BlockUtility} util - the block utility
     * @returns {number} class name if video frame matched, empty number if model not loaded yet
     */
    posePositionY(args, util) {
        if (this.hasPose(args['PERSON_INDEX'])){
            return this.tfCoordsToScratch({y: this.poseStates[args['PERSON_INDEX']].keypoints.find(point => point.name === args['PART']).y}).y;
        }
    }

